import React, {
  Fragment
} from 'react';
import './App.css';

// components

import InputTransaction from "./components/InputTransaction";
import ListTransactions from "./components/ListTransactions";
import EditTransaction from "./components/EditTransaction";


function App() {
  return (
    <Fragment>
      <div className = "container" >
        <InputTransaction />
        <ListTransactions />
        <EditTransaction />
      </div>

    </Fragment>);

  }

  export default App;
